import React from 'react';
import Board from './Board';
import ModuleCard from './Card';
import './plannertemp.css';
import AutoCompleteText from './AutocompleteText';
import { DropdownButton, Dropdown, Button } from 'react-bootstrap';

class ModulePlannerPageTemp extends React.Component {
    constructor(props) {
        super(props)
        this.state = {isTextBoxOpen: true};
        this.generateModuleCards = this.generateModuleCards.bind(this);
        this.handleButtonClick = this.handleButtonClick.bind(this);

    }

    generateModuleCards (object) {
        return(
        <DropdownButton id="dropdown-basic-button" title={object}>
            <Dropdown.Item>Delete</Dropdown.Item>
            </DropdownButton>
        )
    }

    handleButtonClick() {
       // this.setState({isTextBoxOpen: !this.state.isTextBoxOpen})
    }

    render () {
        return (
            <div className="container">
                {this.state.isTextBoxOpen && <AutoCompleteText generateCards={this.generateModuleCards}/>}
                <Board 
                        id="board-1"
                        className="board">
                    <ModuleCard
                        id="card-1"
                        className="card"
                        draggable="true">
                        <p>Card one</p>
                    </ModuleCard>
                    <Button onClick={this.handleButtonClick}>Add Module</Button>
                </Board>

                <Board
                        id="board-2"
                        className="board">
                    <ModuleCard
                        id="card-2"
                        className="card"
                        draggable="true">
                        <p>Card two</p>
                    </ModuleCard>

                </Board>
            </div>
        )
    }
}

export default ModulePlannerPageTemp;
